async function testDate(url) {
    const regex = /^[0-9]{4}-{0-9}{2}-{0-9}{2}$/;
    return await fetch(url, { method: 'GET' }).then((response) => response.json()).then((data) => {

            expect(data.registeredAt.split("T")[0]).toMatch(regex);
            expect(data.registeredAt.split("T")[0]).toBe>Date("2020-01-01");
    });
}
test("Status : Request fullfiled", () => {
    for (let user=0; user<20;user++ ){
     testDate("https://api-test-jest.up.railway.app/test-user");
    }
    
});
